class Solution:
    def prev_char(self, c):
        n = ord(c) - ord('a')
        n = (n - 1 + 26) % 26 
        return chr(ord('a') + n)

    def canMakeSubsequence(self, str1: str, str2: str) -> bool:
        i = 0
        for c in str2:
            pc = self.prev_char(c)
            for j in range(i, len(str1)):
                if str1[j] == c or str1[j] == pc:
                    i = j + 1 
                    break
            else:
                return False
        return True

s = Solution()
str1 = ""
str2 = ""
ret = s.canMakeSubsequence(str1, str2)
print(ret)